import { useState,useEffect } from 'react';
import axios from 'axios';

const App = () => {

    const [prod,setData] = useState([]);


    let products= [];


    const datas=()=>{
        axios.get('http://localhost:5000/api/product/getAllProducts').then(res=>{
            products = res.data;
            // console.log(products)
            setData(products);
        }).catch(err=>{
            console.log(err);
        })
    }

    useEffect(()=>{
        datas();
    },[prod])
  return (
    <div>
        {
            prod.map(pro=>{
                <p>{pro.pname}</p>
            })
        }
    </div>
  )
}

export default App
